This annotation allows to cache results of a method in order to prevent having to compute multiple times the result for a same input. It will generate a cache and make the annotated method use this cache. The cache key is produced with the method parameter(s). If the value for the given input (method parameters) is in the cache, we just return it from the cache. If it isn't in it, we compute the value, put it in the cache and then return it. A perfect example is a recursive implementation of the fibonacci suite. With high numbers, we may compute multiple times the value for a same input, making the operation really long. That's where @cached comes to save the day. No value for a same input will be computed more than once, this will allow to save a lot of time. println(fibonacci(10)) @cached
fun int fibonacci(int n) -> switch (n) { 0, 1 -> n else -> fibonacci(n - 1) + fibonacci(n - 2)
} This script would print Foo(bar=myBar). Caching also work with functions having many parameters println(funnynacci(10, 15)) @cached
fun int funnynacci(int n, int m) -> switch (n) { 0, 1 -> n + m else -> funnynacci(n - 1, m - 1) + funnynacci(n - 2, m - 1)
}

